import React, { Component } from 'react';
import axios from 'axios';
import { Bar } from "react-chartjs-2";

const Analytics = () => {
    return <div>
        <Bar
            data={{
                labels: ["test", "test", "test"],
                datasets: [{
                    label: "Feature 2",
                    data: ["1", "2", "3"],
                }],
            }}
            height={500}
            width={100}
            options={{ maintainAspectRatio: false }}
        />
    </div>
}

export default Analytics;
